import React from "react";
import Button from "./Button";

const Navbar = () => {
  return (
    <nav className="bg-gray-800 text-white px-4 py-2 flex justify-center shadow-md">
      <Button text="Click Me" color="bg-blue-500" />
    </nav>
  );
};

export default Navbar;
